\t\tconst checkUsername = () => {

\t\t\tlet valid = false;

\t\t\tconst min = 3, max = 25;

\t\t\tconst username = elemName.value.trim();

\t\t\tif (!isRequired(username)) {
\t\t\t\tshowError(elemName, 'Username cannot be blank.');
\t\t\t} else if (!isBetween(username.length, min, max)) {
