\t\t\t} else {
\t\t\t\tshowSuccess(elemName);
\t\t\t\tvalid = true;
\t\t\t}
\t\t\treturn valid;
\t\t};

\t\tconst checkEmail = () => {
\t\t\tlet valid = false;
\t\t\tconst email = elemEmail.value.trim();
\t\t\tif (!isRequired(email)) {
\t\t\t\tshowError(elemEmail, 'Email cannot be blank.');
\t\t\t} else if (!isEmailValid(email)) {
\t\t\t\tshowError(elemEmail, 'Email is not valid.')
\t\t\t} else {
\t\t\t\tshowSuccess(elemEmail);
\t\t\t\tvalid = true;
